        <div id="beatWrap" className={`${styles.wrap_beat} ${styles.wrap_notice}`}>
            <Header/>
            <main id="beatContent" className={`${styles.section_notice}`}>
                <a href="#none" className={`${styles.link_unit} ${styles.notify}`}>
                    <span className={`${styles.theme_info}`}>
